import { isPlatformBrowser } from '@angular/common';
import {
  type AfterViewInit,
  Directive,
  ElementRef,
  PLATFORM_ID,
  inject,
} from '@angular/core';
import Atropos from 'atropos';

@Directive({
  selector: '[useAtropos]',
  standalone: true,
})
export class AtroposDirective implements AfterViewInit {
  private readonly platform = inject(PLATFORM_ID);
  private readonly el = inject(ElementRef);
  ngAfterViewInit() {
    if (isPlatformBrowser(this.platform)) {
      Atropos({
        el: this.el.nativeElement,
        alwaysActive: true,
        activeOffset: 40,
        rotateXMax: 15,
        rotateYMax: 15,
        shadowOffset: 40,
        duration: 300,
      });
    }
  }
}

import {
  type AfterViewInit,
  Directive,
  ElementRef,
  inject,
} from '@angular/core';
import VanillaTilt from 'vanilla-tilt';

@Directive({
  selector: '[useVanillaTilt]',
  standalone: true,
})
export class VanillaTiltDirective implements AfterViewInit {
  private el = inject(ElementRef);

  ngAfterViewInit() {
    const tiltContainer = this.el.nativeElement;
    if (!this.isMobile) {
      VanillaTilt.init(tiltContainer, {
        max: 20,
        scale: 1.1,
        speed: 250,
        perspective: 1000,
        transition: true,
        reset: true,
        gyroscope: true,
      });
    }
  }

  private get isMobile(): boolean {
    return window.innerWidth < 768;
  }
}

